$(function(){function i(n){return $.trim(n).replace(/\s+/g," ").toLowerCase()}var n=$("#list"),r=$("#search"),t=n.find("option").clone();t.each(function(){var n=$(this);n.data("sanitized",i(n.text()))});r.on("keyup",function(){var r=i($(this).val()),u;if(!r){n.empty().append(t.clone());return}u=t.filter(function(){return $(this).data("sanitized").indexOf(r)!==-1}).clone();n.empty().append(u)})});$(document).ready(function(){$('[data-toggle="popover"]').popover()});$(function(){$("#datetimepicker1").datetimepicker({icons:{time:"fa fa-clock-o",date:"fa fa-calendar",up:"fa fa-arrow-up",down:"fa fa-arrow-down"}});$("#datetimepicker2").datetimepicker({icons:{time:"fa fa-clock-o",date:"fa fa-calendar",up:"fa fa-arrow-up",down:"fa fa-arrow-down"}})});